import React, { Component } from 'react'
// import '../../styles/current/Pagination.scss'
import {getFirstAndPrevious, getPageNumbers, getLastAndNext, calculateLastPageNumber } from "../../businessLogic/PaginationLogic";
import {nanoid} from 'nanoid'
function Pagination(props) {
  var current = props.c,
      last = props.m,
      delta = 2,
      left = current - delta,
      right = current + delta + 1,
      range = [],
      rangeWithDots = [],
      l;

  for (let i = 1; i <= last; i++) {
      if (i == 1 || i == last || i >= left && i < right) {
          range.push(i);
      }
  }

  for (let i of range) {
      if (l) {
          if (i - l === 2) {
              rangeWithDots.push(l + 1);
          } else if (i - l !== 1) {
              rangeWithDots.push('...');
          }
      }
      rangeWithDots.push(i);
      l = i;
  }

  return <ul>{rangeWithDots.forEach((number) => {
    return(
      <li key={nanoid()} className="page-item">
        <a href="/#"
          onClick={() => {
            props.paginate(number + 1, 5);
          }}
          className="page-link"
        >
          {number + 1}
        </a>
      </li>
    );
  })}</ul>;
}
export default Pagination
